import {Link} from "react-router-dom";

function NavBar() {
    return (
        <header>
            <div>SQL In The Browser</div>
            <nav>
                <ul>
                    <li>
                        <Link to='/'>Query DB</Link>
                    </li>
                    <li>
                        <Link to='/connect'>Connect</Link>
                    </li>
                    <li>
                        <Link to='/manage-users'>Manage Users</Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
}

export default NavBar;
